mask.define(mask.getHandler('ViewManager'), `
	let Progress {
	    slot viewActivity (sender, type) {
	        var vm = this.parent;
	        if (vm !== sender) return;

	        app.find('PageProgress').activity(type === 'start' ? 1 : -1);
	    }
	}
`);
Promise.wait = function (ms) {
    return new Promise(resolve => {
        setTimeout(resolve, ms);
    });
};

